import { motion } from 'framer-motion';
import { products } from '../data/products';
import Product from '../components/Product';

const HomePage = ({ user, cart, addToCart }) => {
  const featuredProducts = products.slice(0, 6);

  return (
    <div className="min-h-screen bg-home">
      <div className="container">
        {/* Hero Section */}
        <section className="py-16 text-center">
          <motion.h1 
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="text-4xl font-bold mb-6"
          >
            My Store
          </motion.h1>
          
          <motion.h2
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.2 }}
            className="text-2xl text-gray-700 mb-8"
          >
            Premium Products for Your Lifestyle
          </motion.h2>
          
          <motion.p
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.4 }}
            className="text-lg text-gray-600 mb-8"
          >
            Discover the latest trends and exclusive items at amazing prices
          </motion.p>
          
          <motion.button
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.6 }}
            className="btn btn-primary text-lg"
          >
            Shop Now →
          </motion.button>
        </section>

        <hr className="border-gray-300 my-12" />

        {/* Featured Products */}
        <section className="py-12">
          <motion.h2
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="text-3xl font-bold text-center mb-12"
          >
            Featured Products
          </motion.h2>
          
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {featuredProducts.map((product, index) => (
              <motion.div
                key={product.id}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: index * 0.1 }}
              >
                <Product product={product} addToCart={addToCart} user={user} />
              </motion.div>
            ))}
          </div>
        </section>

        {/* Categories Section */}
        <section className="py-12">
          <motion.h2
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="text-3xl font-bold text-center mb-12"
          >
            Shop by Category
          </motion.h2>
          
          <div className="grid grid-cols-2 md:grid-cols-3 gap-6">
            {[
              { name: "Clothing", icon: "👕", desc: "Latest fashion trends" },
              { name: "Electronics", icon: "📱", desc: "Gadgets & devices" },
              { name: "Home & Living", icon: "🏠", desc: "Furniture & decor" },
              { name: "Health & Beauty", icon: "💄", desc: "Skincare & wellness" },
              { name: "Sports", icon: "⚽", desc: "Fitness equipment" },
              { name: "Books", icon: "📚", desc: "Best sellers & novels" }
            ].map((category, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: index * 0.1 }}
                className="bg-white rounded-lg p-6 text-center shadow-md hover:shadow-lg transition-shadow"
              >
                <div className="text-3xl mb-4">{category.icon}</div>
                <h3 className="text-xl font-semibold mb-2">{category.name}</h3>
                <p className="text-gray-600">{category.desc}</p>
              </motion.div>
            ))}
          </div>
        </section>

        {/* Health & Beauty Highlight */}
        <section className="py-12">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="bg-gradient-to-r from-pink-50 to-purple-50 rounded-2xl p-8 text-center"
          >
            <h3 className="text-2xl font-bold text-gray-900 mb-4">Health & Beauty</h3>
            <h4 className="text-xl text-gray-700 mb-4">Skincare & Wellness</h4>
            <p className="text-gray-600 mb-6">
              Discover our premium collection of health and beauty products
            </p>
            <button className="btn btn-primary">Explore Collection</button>
          </motion.div>
        </section>
      </div>
    </div>
  );
};

export default HomePage;
